import { defaultImage } from "constants/global";
import React from "react";

const CampaignPerk = () => {
  return (
    <div className="bg-white rounded-lg shadow-1">
      <img
        src={defaultImage}
        className="h-[232px] object-cover rounded-xl "
        alt=""
      />
    </div>
  );
};

export default CampaignPerk;
